import numpy as np, matplotlib.pyplot as plt

def creategraphfordata(data: list, idx: int, name: str = "pid-debug-graph-", ylimit1: int = 500, ylimit2: int = 100000, line = None, position: str = "best"):

    # OBS: [x, y, z] = [error, integral, speed (from Speed Controller)], debugfreq = 20 

    # Extracting values
    error = [point[0] for point in data]
    integral = [point[1] for point in data]

    # Time array (assuming debug frequency of 20 Hz => dt = 0.05s)
    time = np.arange(len(data)) * 0.05  # Time in seconds

    # A4 page = 210 mm x 297 mm
    graphsizee = (150, 75) # in mm

    # Create a figure with 1 row and 1 column of subplots (only one plot)
    fig, ax1 = plt.subplots(figsize=(graphsizee[0] / 25.4, graphsizee[1] / 25.4))

    ax1.set_ylim(-ylimit1, ylimit1)

    # Plot for Error on the first y-axis
    ax1.plot(time, error, label = "Eroare", linestyle='dashed', marker='o', markersize=2)
    ax1.set_xlabel("Timp (secunde)")
    ax1.set_ylabel("Eroare"); ax1.grid(True)

    # Create a second y-axis for the Integral on the same plot
    ax2 = ax1.twinx()  # Create a second y-axis sharing the same x-axis
    ax2.set_ylim(-ylimit2, ylimit2)
    
    ax2.plot(time, integral, label = "Integrala", color = 'orange', linestyle = 'solid')
    ax2.set_ylabel("Integrala")

    if(line != None): ax1.axhline(line, color = '#222222', linestyle = '--', label = 'Target')

    # Combine handles and labels from both axes
    handles, labels = ax1.get_legend_handles_labels()  # Handles and labels from ax1
    handles2, labels2 = ax2.get_legend_handles_labels()  # Handles and labels from ax2

    # Combine the handles and labels
    handles.extend(handles2)
    labels.extend(labels2)

    plt.legend(handles, labels, loc = position)

    # Adjust layout for better spacing
    plt.tight_layout()

    # Save the plot as an SVG file
    plt.savefig("Matplotlib Graphs/" + name + str(idx) + ".svg")

    plt.close() # Stop this plot


